export default function Map() {
  const latitude = 28.88566667716725;
  const longitude = 76.68104713971542;
  const mapUrl = `https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1021.8545271774815!2d${longitude}!3d${latitude}!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x390d9b032f3f1007%3A0x3ab4fe928fc5c0fc!2sMaruti%20Suzuki%20India%20Ltd.%20R%26D%20Plant!5e1!3m2!1sen!2sin!4v1706091534569!5m2!1sen!2sin`;
  return (
    <div className="map">
      <iframe
        src={mapUrl}
        width="800"
        height="600"
        allowFullScreen
        loading="lazy"
        referrerPolicy="no-referrer-when-downgrade"
      ></iframe>
    </div>
  );
}
